import React from "react";
import "../navBar.css";
import List from "@material-ui/core/List";
import { Switch, Route } from "react-router-dom";
import Package from "../../package/Package";
const NavBarBtn = (props) => {
  return (
    <Switch>
      <List className="navBarList">
        <Route className="navBarBtn" path="/login" exact component={Package}>

        </Route>
        <Route className="navBarBtn" path="/packages" exact component={Package}>

        </Route>
      </List>
    </Switch>
  );
};
export default NavBarBtn;
